#include <iostream>#include <vector>int main(){    int n, m;    std::cin >> n >> m;    std::vector<std::string> a(n);    std::vector<std::string> b(m);    for(int i = 0; i < n; ++i){        std::cin >> a.at(i);    }    for(int i = 0; i < m; ++i){        std::cin >> b.at(i);    }    int counter = 0;    for(int i = 0; i < n - m; ++i){        for(int j = i; j < i + m; ++j){            for(int k = i; k < i + m; ++k){                if(a.at(j).at(k) == b.at(j- i).at(k - i)){                    ++counter;                }            }        }    }    if(m*m < counter){        std::cout << "Yes" << std::endl;    }else{        std::cout << "No" << std::endl;    }    return 0;}